from sympy import factorint
def sigma_mod(n, m): # computes sigma(n) mod m
    y = 1
    for p, e in factorint(n).items():
        y  = (y*(p**(e + 1) - 1)//(p - 1)) % m
    return y
A254999_list = [n for n,m in ((4*k+2, sigma_mod(4*k+2,4*k+2)) for k in range(10**6)) if m and not n % m]
